import React, { Component } from 'react';
import { Button } from 'semantic-ui-react';
import Layout from '../../../components/Layout';

class StudentPage extends Component {
  render() {
    return (
      <Layout>
        <div>
          <h1>Student's Transcript</h1>
        </div>
      </Layout>
    );
  }
}

export default StudentPage;
